import React, { useState } from 'react';
import { MOCK_SINGLE_RESULT } from '../data/mockData';
import DemoHeader from './DemoHeader';

const SingleAnalysis = () => {
  const [inputText, setInputText] = useState('');
  const [result, setResult] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  const analyzeText = () => {
    if (!inputText.trim()) {
      alert('Please enter some text to analyze');
      return;
    }

    setIsAnalyzing(true);

    setTimeout(() => {
      const mockResult = {
        ...MOCK_SINGLE_RESULT,
        model_info: {
          ...MOCK_SINGLE_RESULT.model_info,
          timestamp: new Date().toISOString()
        }
      };
      setResult(mockResult);
      setIsAnalyzing(false);
    }, 1500);
  };

  const loadSampleText = () => {
    setInputText('Led security architecture initiatives for enterprise cloud migration, implementing zero-trust frameworks and identity access management systems. Conducted threat assessments and vulnerability analyses, ensuring compliance with ISO27001 and GDPR regulations. Managed incident response procedures and coordinated with SOC teams for continuous security monitoring.');
  };

  const clearAnalysis = () => {
    setInputText('');
    setResult(null);
  };

  return (
    <section className="services">
      <div className="container">
        <div className="section-title">
          <h2>Single Analysis</h2>
          <p>Paste job or resume text to extract relevant skills.</p>
        </div>

        <div className="card p-4">
          <div className="mb-3">
            <label htmlFor="text-input" className="form-label">Text to Analyze</label>
            <textarea
              id="text-input"
              className="form-control"
              rows="6"
              value={inputText}
              onChange={(e) => setInputText(e.target.value)}
              placeholder="Paste resume content, job description, or any text to extract skills..."
            />
          </div>

          <div className="d-flex gap-2 mb-4">
            <button className="btn btn-success" onClick={analyzeText} disabled={isAnalyzing || !inputText.trim()}>
              {isAnalyzing ? 'Extracting...' : 'Extract Skills'}
            </button>
            <button className="btn btn-outline-secondary" onClick={loadSampleText}>
              Load Sample
            </button>
            <button className="btn btn-outline-danger" onClick={clearAnalysis}>
              Clear
            </button>
          </div>

          {result && (
            <div className="pt-3">
              <h5>Skill Extraction Results</h5>
              <p className="text-muted">Analyzed: {new Date(result.model_info.timestamp).toLocaleString()}</p>

              <div className="bg-light p-3 rounded mb-3 border">
                <h6 className="mb-1" style={{ color: result.prediction.category_color }}>{result.prediction.category_name}</h6>
                <small className="text-muted">{result.prediction.category_description}</small>
              </div>

              <h6 className="mb-2">Extracted Skills ({result.skills.skill_count})</h6>
              <div className="row g-2">
                {result.skills.extracted_skills.map((skill, index) => (
                  <div key={index} className="col-md-6">
                    <div className="border p-2 rounded">
                      <strong>{skill.name}</strong>
                      <p className="mb-0 text-muted small">{skill.description}</p>
                    </div>
                  </div>
                ))}
              </div>

              <div className="mt-3">
                <p><strong>Mode:</strong> {result.model_info.mode}</p>
                <p><strong>Extractor:</strong> {result.model_info.extractor_mode}</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </section>
  );
};

export default SingleAnalysis;
